def predict(triples: list[Triple]) -> str:
    university_info = {}
    for triple in triples:
        if triple.subject not in university_info:
            university_info[triple.subject] = {}
        university_info[triple.subject][triple.predicate] = triple.object

    sentence = ""
    for university, data in university_info.items():
        sentence += f"{university} "
        if "established" in data and "location" in data:
            sentence += f"was established in {data['established']} and is located in {data['location']}. "
        elif "established" in data:
            sentence += f"was established in {data['established']}. "
        elif "location" in data:
            sentence += f"is located in {data['location']}. "

        if "numberOfStudents" in data and "staff" in data:
            sentence += f"It has {data['numberOfStudents']} students and a staff of {data['staff']}. "
        elif "numberOfStudents" in data:
            sentence += f"It has {data['numberOfStudents']} students. "
        elif "staff" in data:
            sentence += f"It has a staff of {data['staff']}. "

        if "rector" in data:
            sentence += f"The rector is {data['rector']}. "

    return sentence.strip()

